import React, { Component } from 'react';

// Style
import './styles.scss';

class CitiesCard extends Component {
  render() {
    const { background, city, availableJobs } = this.props;
    return (
      <a
        className='cities-specific-card-style'
        href='/cities/city'
        style={{ backgroundImage: `url(${background})` }}
      >
        <p className='cities'>{city}</p>
        <p className='cities'>{availableJobs}</p>
      </a>
    );
  }
}

export default CitiesCard;
